import "hardhat/console.sol";
interface IERC20 {
    /**
     * @dev Returns the amount of tokens in existence.
     */
    function totalSupply() external view returns (uint256);

    /**
     * @dev Returns the amount of tokens owned by `account`.
     */
    function balanceOf(address account) external view returns (uint256);

    /**
     * @dev Moves `amount` tokens from the caller's account to `recipient`.
     *
     * Returns a boolean value indicating whether the operation succeeded.
     *
     * Emits a {Transfer} event.
     */
    function transfer(address recipient, uint256 amount) external returns (bool);

    /**
     * @dev Returns the remaining number of tokens that `spender` will be
     * allowed to spend on behalf of `owner` through {transferFrom}. This is
     * zero by default.
     *
     * This value changes when {approve} or {transferFrom} are called.
     */
    function allowance(address owner, address spender) external view returns (uint256);

    /**
     * @dev Sets `amount` as the allowance of `spender` over the caller's tokens.
     *
     * Returns a boolean value indicating whether the operation succeeded.
     *
     * IMPORTANT: Beware that changing an allowance with this method brings the risk
     * that someone may use both the old and the new allowance by unfortunate
     * transaction ordering. One possible solution to mitigate this race
     * condition is to first reduce the spender's allowance to 0 and set the
     * desired value afterwards:
     * https://github.com/ethereum/EIPs/issues/20#issuecomment-263524729
     *
     * Emits an {Approval} event.
     */
    function approve(address spender, uint256 amount) external returns (bool);

    /**
     * @dev Moves `amount` tokens from `sender` to `recipient` using the
     * allowance mechanism. `amount` is then deducted from the caller's
     * allowance.
     *
     * Returns a boolean value indicating whether the operation succeeded.
     *
     * Emits a {Transfer} event.
     */
    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool);

    function name() external view returns (string memory);

    function symbol() external view returns (string memory);

    function decimals() external view returns (uint256);
    /**
     * @dev Emitted when `value` tokens are moved from one account (`from`) to
     * another (`to`).
     *
     * Note that `value` may be zero.
     */
    event Transfer(address indexed from, address indexed to, uint256 value);

    /**
     * @dev Emitted when the allowance of a `spender` for an `owner` is set by
     * a call to {approve}. `value` is the new allowance.
     */
    event Approval(address indexed owner, address indexed spender, uint256 value);
}


interface IPancakeFactory {
    event PairCreated(address indexed token0, address indexed token1, address pair, uint);

    function feeTo() external view returns (address);

    function feeToSetter() external view returns (address);

    function getPair(address tokenA, address tokenB) external view returns (address pair);

    function allPairs(uint) external view returns (address pair);

    function allPairsLength() external view returns (uint);

    function createPair(address tokenA, address tokenB) external returns (address pair);

    function setFeeTo(address) external;

    function setFeeToSetter(address) external;
}

interface IPancakeRouter01 {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);

    function quote(uint amountA, uint reserveA, uint reserveB) external pure returns (uint amountB);

    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut) external pure returns (uint amountOut);

    function getAmountIn(uint amountOut, uint reserveIn, uint reserveOut) external pure returns (uint amountIn);

    function getAmountsOut(uint amountIn, address[] calldata path) external view returns (uint[] memory amounts);

    function getAmountsIn(uint amountOut, address[] calldata path) external view returns (uint[] memory amounts);
}

interface IQuoter {
    function getQuote(address who, address token) external returns (Structs.QuoteData memory);
}

library Structs {
    struct QuoteData {
        TokenInfo base;
        TokenInfo token;
        address pairAddress;
        address routerAddress;
        address factoryAddress;
        uint256 tokenBalance; // token balance of the user
        uint256 quote; // value of the user's token balance in usd according to the pair price
        uint256 nativeReserves; // balance of base token in the pair
    }

    struct TokenInfo {
        string name;
        string symbol;
        uint256 decimals;
        address addr;
    }
}

contract DataAggregator {
    address UNI_V2_ROUTER = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D;
    address UNI_V2_FACTORY = 0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f;
    address ETH = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;
    address USDT = 0xdAC17F958D2ee523a2206206994597C13D831ec7;
    address USDC = 0xA0b86991c6218b36c1d19D4a2e9Eb0cE3606eB48;

    constructor(address router, address factory, address WETH, address USDC_, address USDT_){
        UNI_V2_ROUTER = router;
        UNI_V2_FACTORY = factory;
        ETH = WETH;
        USDC = USDC_;
        USDT = USDT_;
    }

    // returns pair address if exists, and quote in $ of the token accoridng to the price.
    function getQuote(address who, address token, address base) public view returns (Structs.QuoteData memory){
        uint256 amountIn = IERC20(token).balanceOf(who);

        IPancakeRouter01 router = IPancakeRouter01(UNI_V2_ROUTER);
        address pair = IPancakeFactory(UNI_V2_FACTORY).getPair(token, base);

        Structs.QuoteData memory q;
        q.routerAddress = UNI_V2_ROUTER;
        q.factoryAddress = UNI_V2_FACTORY;
        q.pairAddress = pair;
        q.nativeReserves = IERC20(base).balanceOf(pair);
        q.tokenBalance = amountIn;

        if (base != USDC && base != USDT) {
            // base is not a stable coin so compute [token, base, usdt]
            address[] memory path = new address[](3);
            path[0] = (token);
            path[1] = (base);
            path[2] = (USDT);

            try router.getAmountsOut(amountIn, path) returns (uint256[] memory amounts){
                q.quote = amounts[path.length - 1];
            } catch{}

        } else {
            // base is a stable coin, so compute direct path [token, base]
            address[] memory path = new address[](2);
            path[0] = (token);
            path[1] = (base);

            try router.getAmountsOut(amountIn, path) returns (uint256[] memory amounts){
                q.quote = amounts[path.length - 1];
            } catch{}
        }

        return q;
    }

    // Gets the best price of the given token among the base tokens we check
    // quoter can be used to dynamically check more base tokens and exchanges
    function getBestQuote(address who, address token, address quoter) external returns (Structs.QuoteData memory){
        console.log("here!!!");
        address[] memory bases = new address[](3);
        bases[0] = (ETH);
        bases[1] = (USDT);
        bases[2] = (USDC);

        // Go over all bases and find the best quote for the token
        Structs.QuoteData memory bestQuote;
        address bestBase = USDT;

        for (uint i = 0; i < bases.length; i++) {
            Structs.QuoteData memory currentQuote = getQuote(who, token, bases[i]);
            if (bestQuote.quote < currentQuote.quote) {
                bestQuote = currentQuote;
                bestBase = bases[i];
            }
        }
        // Optionally use an external quoter to get other quotes
        // This can be used to add uniswap v3 and other exchanges support, after the fact
        if (quoter != address(0)) {
            Structs.QuoteData memory q = IQuoter(quoter).getQuote(who, token);
            if (bestQuote.quote < q.quote) {
                bestQuote = q;
                bestBase = q.base.addr;
            }
        }

        try this.getERC20Info(bestBase) returns (Structs.TokenInfo memory res) {
            bestQuote.base = res;
        } catch {}

        return bestQuote;
    }

    // Collects basic ERC20 info of the given token, safely
    function getERC20Info(address token) external view returns (Structs.TokenInfo memory) {
        Structs.TokenInfo memory tInfo;
        try IERC20(token).name() returns (string memory name) {
            tInfo.name = name;
        } catch {tInfo.name = "";}
        try IERC20(token).symbol() returns (string memory symbol) {
            tInfo.symbol = symbol;
        } catch {tInfo.symbol = "";}
        try IERC20(token).decimals() returns (uint256 decimals) {
            tInfo.decimals = decimals;
        } catch {tInfo.decimals = 0;}
        tInfo.addr = token;

        return tInfo;
    }

    function getData(address [] memory tokens, address who, address quoter) external returns (Structs.QuoteData[] memory) {
        Structs.QuoteData[] memory tokensData_ = new Structs.QuoteData[](tokens.length);
        for (uint256 i = 0; i < tokens.length; i++) {
            Structs.QuoteData memory q;
            try this.getBestQuote(who, tokens[i], quoter) returns (Structs.QuoteData memory res) {
                q = res;
            } catch {}

            try this.getERC20Info(tokens[i]) returns (Structs.TokenInfo memory res) {
                q.token = res;
            } catch {
                Structs.TokenInfo memory tok;
                tok.addr = tokens[i];
                q.token = tok;
            }

            tokensData_[i] = q;
        }

        return tokensData_;
    }

    function testRet() public view returns(Structs.TokenInfo memory) {
        Structs.TokenInfo memory tok;
        tok.addr = address(1);

        return tok;
    }

    function testRet2() public view returns(Structs.QuoteData memory) {
        Structs.QuoteData memory tok;
        tok.pairAddress = address(1);
        tok.routerAddress = address(2);
        tok.base = testRet();

        return tok;
    }
}
